import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 10.1-525 Canvassing returns.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/10.1-525.md","filePath":"vacode/10.1-525.md"}'),i={name:"vacode/10.1-525.md"},n=t('<h1 id="§-10-1-525-canvassing-returns" tabindex="-1">§ 10.1-525 Canvassing returns. <a class="header-anchor" href="#§-10-1-525-canvassing-returns" aria-label="Permalink to &quot;§ 10.1-525 Canvassing returns.&quot;">​</a></h1><p>The result of the election shall be canvassed and certified by the electoral board for the county or city in which the candidate resides pursuant to §§ <a href="http://law.lis.virginia.gov/vacode/24.2-671/" target="_blank" rel="noreferrer">24.2-671</a> through <a href="http://law.lis.virginia.gov/vacode/24.2-678/" target="_blank" rel="noreferrer">24.2-678</a>. The State Board of Elections shall, promptly after the meeting required by § <a href="http://law.lis.virginia.gov/vacode/24.2-679/" target="_blank" rel="noreferrer">24.2-679</a>, certify to the Director of the Department of Conservation and Recreation a list of the candidates elected and certified as Directors of Soil and Water Conservation Districts, as reported pursuant to § <a href="http://law.lis.virginia.gov/vacode/24.2-675/" target="_blank" rel="noreferrer">24.2-675</a>.</p><p>Code 1950, § 21-38; 1960, c. 208; 1964, c. 512; 1988, c. 891; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0053" target="_blank" rel="noreferrer">53</a>; 2002, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0143" target="_blank" rel="noreferrer">143</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0236" target="_blank" rel="noreferrer">236</a>.</p>',3),o=[n];function s(l,c,d,h,f,_){return r(),a("div",null,o)}const v=e(i,[["render",s]]);export{p as __pageData,v as default};
